  [],\n\t\"revision_timestamp\": \"2016-07-27T22:45:40.343795\",\n\t\"name\": \"narrative-report-for-september-october-november-december-1945-des-lacs-national-wildlife-r\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Des Lacs National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1945. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and collections and receipts. Resource management is outlined; topics
  include grazing and haying. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, fishing, and
  violations. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
